import React, { useEffect, useRef, useState } from 'react';
import './App.css';
import { PatientVisualizer } from 'fhir-visualizers';
import { useForm } from 'react-hook-form'; // Import react-hook-form functions
import { Spinner, Container, Button, Form } from 'react-bootstrap';

export default function App(props) {
  const client = props.client;
  const [patient, setPatient] = useState(null);
  const lastReport = useRef(null);
  const reports = useRef(null);
  const observation = useRef(null);
  const isDeletingReport = useRef(false);
  const isCreatingReport = useRef(false);
  const isViewingObservation = useRef(false);
  const [reportId, setReportId] = useState('');
  const [observationId, setObservationId] = useState('');

  const getReports = () => {
    client.patient.request('DiagnosticReport').then((response) => {
      let studies = response.entry.map((entry) => entry.resource);
      reports.current = studies;
    });
  };

  const getObservations = () => {
    client.request(`Observation?_id=${observationId}`).then((response) => {
      let observations = response.entry.map((entry) => entry.resource);
      observation.current = observations;
    });
  };

  useEffect(() => {
    client.patient.read().then((patient) => setPatient(patient));

    if (reports.current == null) {
      getReports();
    }

    if (isViewingObservation.current) {
      getObservations();
      isViewingObservation.current = false;
    }

    if (isDeletingReport.current) {
      client.delete('DiagnosticReport/' + reportId);
      console.log('Deleted report with id: ' + reportId);
      reports.current = null;
      isDeletingReport.current = false;
    }

    if (isCreatingReport.current) {
      const diagnosticReport = {
        resourceType: 'DiagnosticReport',
        id: '1943319',
        status: 'final',
        code: {
          coding: [
            {
              system: 'http://loinc.org',
              code: '12345-6',
              display: 'complete Blood Count',
            },
          ],
          text: 'CBC Report',
        },
        subject: {
          reference: 'Patient/' + client.patient.id,
        },
        conclusionCode: {
          coding: [
            {
              system: 'http://snomed.info/sct',
              code: '123456789',
              display: 'Anemia',
            },
          ],
          text: 'Anemia',
        },
        conclusion: '', // Put impression here
        issued: '2023-10-06T10:00:00Z',
      };

      client.create(diagnosticReport);
      console.log('Created report');
      reports.current = null;
      isCreatingReport.current = false;
    }
  });

  const createReport = () => {
    isCreatingReport.current = true;
  };

  const deleteReport = () => {
    isDeletingReport.current = true;
  };

  let pat = patient ? (
    <PatientVisualizer patient={patient} />
  ) : (
    <Spinner />
  );

  const { register, handleSubmit } = useForm();
  const onSubmit = (data) => {
    let np = patient;
    np.name[0].given[0] = data.fname;
    np.name[0].family = data.lname;
    setPatient(np);
    client.update(np);
  };

  const handleFileUpload = (selectedFile) => {
    // Implement the DICOM file upload functionality here
    // ...

    // You can use the `selectedFile` and send it to the server
  };

  return (
    <div id="app">
      <Container>{pat}</Container>
      {patient ? (
        <Container>
          <h4>Update Patient Name</h4>
          <Form onSubmit={handleSubmit(onSubmit)}>
            <Form.Group className="mb-3" controlId="formFirst">
              <Form.Label>First</Form.Label>
              <Form.Control
                type="text"
                {...register('fname')}
                defaultValue={patient.name[0].given.join(' ')}
              />
            </Form.Group>
            <Form.Group className="mb-3" controlId="formLast">
              <Form.Label>Last</Form.Label>
              <Form.Control
                type="text"
                {...register('lname')}
                defaultValue={patient.name[0].family}
              />
            </Form.Group>
            <Button type="submit">Update</Button>
          </Form>
        </Container>
      ) : (
        <Spinner />
      )}

      <Container>
        <input
          type="file"
          id="fileInput"
          onChange={(e) => handleFileUpload(e.target.files[0])}
          accept=".dcm"
        />
      </Container>

      <Container>
        <br />
        <h4>Fetch API Report</h4>
        <pre id="apiResponse">API response will be logged here</pre>
        {lastReport.current != null ? (
          lastReport.current.map((apifhir, index) => (
            <div key={index}>
              <h5>Report {index + 1}</h5>
              <pre>{JSON.stringify(apifhir, null, 2)}</pre>
            </div>
          ))
        ) : (
          <p>No existing reports available.</p>
        )}
      </Container>

      <Container>
        <br />
        <h4>Existing Report</h4>
        {reports.current != null ? (
          reports.current.map((report, index) => (
            <div key={index}>
              <h5>Report {index + 1}</h5>
              <pre>{JSON.stringify(report, null, 2)}</pre>
            </div>
          ))
        ) : (
          <p>No existing reports available.</p>
        )}
      </Container>
    </div>
  );
}
